 import React, { Component } from 'react'

 
function Form(props) {

    
       return (
             <div>
                <form id="searchForm">
			        <h3>Begin the searching!</h3>
			        <input value={this.props.userInput}placeholder="Search Movies..."></input>
		
                    <button onClick={this.props.fetchMovies}>Movies</button>
		</form>
             </div>
             
         )
         
     
     
 }
 
 export default Form
